import React from 'react';
import Link from 'next/link';

const Menu: React.FC = () => {
    return <nav>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/components">
            <a>Components</a>
        </Link>
    </nav>
};

export default Menu;
